import "./App.css";
import { useState } from "react";
import { Route, Routes } from "react-router";

import Edit from "./pages/Edit";
import Home from "./pages/Home";
import Preview from "./pages/Preview";

function App() {
  const [fileName, setFileName] = useState(null);
  const [uploadedFile, setUploadedFile] = useState(null);
  const [uploadedFileDownloadLink, setUploadedFileDownloadLink] =
    useState(null);

  console.log(uploadedFileDownloadLink);

  return (
    <Routes>
      <Route
        path="/"
        element={
          <Home setFileName={setFileName} setUploadedFile={setUploadedFile} />
        }
      />
      <Route
        path="/edit"
        element={
          <Edit
            fileName={fileName}
            uploadedFile={uploadedFile}
            setUploadedFileDownloadLink={setUploadedFileDownloadLink}
          />
        }
      />
      <Route path="/preview" element={<Preview />} />
    </Routes>
  );
}

export default App;
